import React from "react";

function navbar() {
  return (
    <div>
      <nav class="navbar navbar-light" style={{ backgroundColor: "#e3f2fd" }}>
        <div class="container-fluid">
          <a class="navbar-brand" href="/">
            Time-Table
          </a>
        </div>
      </nav>
    </div>
  );
}

export default navbar;
